import React, { useState } from "react";
import "./frequently.css";


const Frequently = ()=>{

    let [according, setAccording] = useState([
        {
            title:"How much time does it take?1",
            description:"Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua",
       
        },
        {
            title:"How much time does it take?2",
            description:"Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua",
       
        },
        {
            title:"How much time does it take?3",
            description:"Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua",
       
        }
    ])



    return (
        <>
    <div className="FAQ">
        <div className="container">
            <div className="row">
                <div className="FAQ__title">
                    <h2>Frequently asked questions</h2>
                    <p>Contact us for more info</p>
                </div>
                <div className="FAQ__accordian">
                    {according.map((item)=>(
                    <div className="FAQ__que">
                        <div className="FAQ_que_num">
                            01
                        </div>
                        <div className="FAQ_que_ans">
                            <h2>{item.title}
                                <i className="fa-solid fa-xmark"></i>
                            </h2>
                            <p> {item.tit}</p>
                        </div>
                    </div>
                    ))}
                 
                </div>
            </div>
        </div>
    </div>
        </>
    );
}

export default Frequently;
